SET FOREIGN_KEY_CHECKS=0;
START TRANSACTION;


-- Ap√≥s o seed, preencher suite_br a partir de observacoes (primeiro n√∫mero encontrado)
-- Mant√©m observacoes intacta (se houver mais de um n√∫mero, pega apenas o primeiro)
UPDATE `clientes` c
SET `suite_br` = (
  CASE
    WHEN REPLACE(TRIM(SUBSTRING_INDEX(c.`observacoes`, ',', 1)), ' ', '') REGEXP '^[0-9]+$'
      AND NOT EXISTS (
        SELECT 1 FROM `clientes` c2
        WHERE c2.`suite_br` = REPLACE(TRIM(SUBSTRING_INDEX(c.`observacoes`, ',', 1)), ' ', '')
      )
    THEN REPLACE(TRIM(SUBSTRING_INDEX(c.`observacoes`, ',', 1)), ' ', '')

    WHEN REPLACE(TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(c.`observacoes`, ',', 2), ',', -1)), ' ', '') REGEXP '^[0-9]+$'
      AND NOT EXISTS (
        SELECT 1 FROM `clientes` c2
        WHERE c2.`suite_br` = REPLACE(TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(c.`observacoes`, ',', 2), ',', -1)), ' ', '')
      )
    THEN REPLACE(TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(c.`observacoes`, ',', 2), ',', -1)), ' ', '')

    WHEN REPLACE(TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(c.`observacoes`, ',', 3), ',', -1)), ' ', '') REGEXP '^[0-9]+$'
      AND NOT EXISTS (
        SELECT 1 FROM `clientes` c2
        WHERE c2.`suite_br` = REPLACE(TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(c.`observacoes`, ',', 3), ',', -1)), ' ', '')
      )
    THEN REPLACE(TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(c.`observacoes`, ',', 3), ',', -1)), ' ', '')
    ELSE NULL
  END
)
WHERE (c.`suite_br` IS NULL OR c.`suite_br` = '')
  AND c.`observacoes` IS NOT NULL
  AND c.`observacoes` REGEXP '[0-9]';

COMMIT;
SET FOREIGN_KEY_CHECKS=1;
